import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import SortAge from "./components/SortAge";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/sortage" element={<SortAge />} />
      </Routes>
    </div>
  );
}

export default App;
